const App = (props) => {
    props.state = {
        todoData: [
            { status: 'active', text: 'Take a shower', id: 1 },
            { status: 'completed', text: 'Drink coffee', id: 2 },
            { status: 'editing', text: 'Watching YouTube', id: 3 }
        ]
    }
    return (
        <section className="todoapp">
            <Header />
            <Main />
        </section>
    );
};
export default App;
